import React from 'react';
import { Box, TextField, Item } from '@material-ui/core';

const signUp = () => {
    return (
        <div>
            <h1>Registration Form</h1>
            <Box
                component="form"
                sx={{
                    '& > :not(style)': { m: 1, width: '25ch' },
                    display:'grid',
                    gridTemplateRows: 'repeat(3, 1fr)'
                }}
                noValidate
                autoComplete="off"
            >
                <Item><TextField type="text" id="outlined-basic" label="Name" variant="outlined" /></Item>
                <Item><TextField type="text" id="outlined-basic" label="Email" variant="outlined" /></Item>
                <Item><TextField type="password" id="outlined-basic" label="Password" variant="outlined" /></Item>
            </Box>
        </div>
    )
}

export default signUp;
